import React from 'react';
// import ReactDOM from 'react-dom';




function Footer(props) {
    return (
    <div className="outsideFooterDiv">
        <footer className="bottom">
             <p>Created by: Kristian Neely</p>
        </footer>
        <p>
            Memory Game!
        </p>
    </div>
        
    );
  }

  

export default Footer;
